import React from "react";
import { Route, Routes } from 'react-router-dom';

import Home from "./Home";

function RoutesTree() {
    return(
        <Routes>
            <Route path='/' element={<Home />}></Route>
            {/* <Route path='/events' element={<Events />}></Route>s */}
        </Routes>
    ) 
}

export default RoutesTree;
